Debug the following Python script that calculates the factorial of a number:

    ```python
    def factorial(n):
        if n == 0:
            return 1
        else:
            return n * factorial(n - 1)

    print(factorial(-5))  # Should return an error, fix it
    ```

    Identify and fix the issue so that the function handles negative numbers correctly.

