Debug the following C++ code snippet that implements a linked list:

    ```cpp
    #include <iostream>

    struct Node {
        int data;
        Node* next;
    };

    void insert(Node*& head, int value) {
        Node* newNode = new Node;
        newNode->data = value;
        newNode->next = head;
        head = newNode;
    }

    void printList(Node* head) {
        while (head != NULL) {
            std::cout << head->data << " -> ";
            head = head->next;
        }
        std::cout << "NULL" << std::endl;
    }

    int main() {
        Node* head = NULL;
        insert(head, 10);
        insert(head, 20);
        insert(head, 30);

        printList(head);

        delete head;  // Bug: Improper memory deallocation, fix it
        return 0;
    }
    ```

    Fix the memory leak issue in the program.

