Annotate the following Java program that implements a binary search algorithm:

    ```java
    public class BinarySearch {
        public static int search(int[] arr, int target) {
            int left = 0, right = arr.length - 1;
            while (left <= right) {
                int mid = left + (right - left) / 2;
                if (arr[mid] == target)
                    return mid;
                if (arr[mid] < target)
                    left = mid + 1;
                else
                    right = mid - 1;
            }
            return -1;
        }

        public static void main(String[] args) {
            int[] numbers = {1, 3, 5, 7, 9, 11};
            System.out.println(search(numbers, 7)); // Expected output: 3
        }
    }
    ```

    Your task is to add explanatory comments to improve readability.

