Annotate the following JavaScript code that creates dynamic web content:

    ```javascript
    document.addEventListener("DOMContentLoaded", function() {
        let button = document.createElement("button");
        button.innerText = "Click Me";
        document.body.appendChild(button);

        button.addEventListener("click", function() {
            let div = document.createElement("div");
            div.innerText = "You clicked the button!";
            document.body.appendChild(div);
        });
    });
    ```

    Your task is to add comments explaining event handling and DOM manipulation in this script.

Optimize the following inefficient sorting function to use a more efficient algorithm:

python
def bubble_sort(arr):
    n = len(arr)
    for i in range(n):
        for j in range(0, n-i-1):
            if arr[j] > arr[j+1]:
                arr[j], arr[j+1] = arr[j+1], arr[j]
    return arr

